import FileCloak from '../FileCloak.webp';
import './SignUp.css';

function SignIn() {

  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };
  
  return (
    <>
      <div className="login-container" id="registerForm">
          <div className="logo-container">
            <img src={FileCloak} className="HomePage-logo" alt="FileCloak" />
          </div>
          <form className="login-form">
              <div className="input-group">
                  <input type="text" id="email" name="email" placeholder="Email" required></input>
                  <i className="icon email-icon"></i> 
              </div>
              <div className="input-group">
                  <input type="password" id="password" name="password" placeholder="Password" required></input>
                  <i className="icon password-icon"></i> 
              </div>
              <div className="input-group">
                  <input type="password" id="repeatPassword" name="repeatPassword" placeholder="Repeat Password" required></input>
                  <i className="icon password-icon"></i> 
              </div>
              <button type="submit" className="button" value="Register">SIGNUP</button>
              <button type="button" className="login-btn">Login</button>
          </form>
      </div>
    </>
  );
}

export default SignIn;
